import axios from 'axios'
export const FETCH_POSTS = "POSTS/FETCH_POSTS"



export function fetchPosts () {
    const request = axios.get('http://localhost:5000/api/auth/books');
    return(
        {
             type: FETCH_POSTS,
             payload: request
        }
    )
}
